    true,nt"url": null,nt"notes": "<p>The Health Information National Trends
    Survey (HINTS) is a biennial, cross-sectional survey of a nationally-representative
    sample of American adults that is used to assess the impact of the health information
    environment. The survey provides updates on changing patterns, needs, and information
    opportunities in health; Identifies changing communications trends and practices;
    Assesses cancer information access and usage; Provides information about how cancer
    risks are perceived; and Offers a testbed to researchers to test new theories in
    health communication.&#13;&#13;&#13;</p>n",nt"license_title": "Other License
